export const UPDATE_COUNT = "UPDATE_COUNT";
export const UPDATE_DATA = "UPDATE_DATA";

const getInitialQuery = (results : any) => ({
    type: UPDATE_COUNT,
    results
});

const updateData = (searchResult: any) => ({
    type: UPDATE_DATA,
    searchResult
});

export { getInitialQuery, updateData };
